import { useForm } from 'react-hook-form';

function addFileHandler(data) {
  console.log(data);
  window.location.href = "/account";
}

function Account(props) {
  const {
    register,
    handleSubmit,
    formState: { errors },
  } = useForm();

  return (
    <table style={{'tableLayout': 'fixed', 'width': '100%', 'height': '100%'}}>
      <tbody>
        <tr style={{"height": "66%"}}>
          <td style={{"width": "30%"}}>
            <div><p>Username: {localStorage.getItem("username")}</p></div>
            <div><p>Email: ?????</p></div>
            <div><p>Full name: ?????</p></div>
            <div><p>Date of birth: ?????</p></div>
          </td>
          <td rowSpan="2" style={{"width": "60%"}}></td>
        </tr>
        <tr style={{"height": "33%"}}>
          <td style={{"width": "30%"}}>
            <form onSubmit={handleSubmit(addFileHandler)}>
              <div>
                  <label>Filename</label>
                  <input {...register('filename', { required: true })} />
                  {errors.username && <p>Filename is required.</p>}
              </div>
              <div>
                  <label>File</label>
                  <input type='text' {...register('password', { pattern: /.......*/ })} />
                  {errors.password && <p>Password must be at least 6 symbols long.</p>}
              </div>
              <button>Upload file</button>
            </form>
          </td>
        </tr>
      </tbody>
    </table>
  );
}

export default Account;
